import { combineReducers } from "redux";
import mageCharacReducer from "./charac_mage";
import rogueCharacReducer from "./charac_rogue";
import warriorCharacReducer from "./charact_warrior";

const finalReducer = combineReducers({
  mageCharacReducer,
  rogueCharacReducer,
  warriorCharacReducer,
});

export default finalReducer;
